import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field by its placeholder and type 'iPhone'
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate and click the search button
    // We select the first button with class 'search-btn' which is associated with the main search bar
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // 3. Wait for search results to be displayed and take a screenshot
    // The JavaScript on the page dynamically creates this header.
    await page.waitForSelector('h2:has-text("Search Results for")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract the results count to verify the search
    const resultsCountElement = page.locator('.results-count');
    const resultsText = await resultsCountElement.textContent();

    return {
      success: true,
      action: "Searched for 'iPhone' and verified results were displayed.",
      extractedData: {
        searchText: 'iPhone',
        resultsCount: resultsText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
